const tasks = (state =  [
    {
        id: '1605810959227',
        value: 'Milk',
        priority: 'low'
    },
    {
        id: '1605810977955',
        value: 'Bread',
        priority: 'high'
    },
    {
        id: '1605811001826',
        value: 'Butter',
        priority: 'mid'
    }
], action) => {
    // console.log(action);
    switch(action.type){
        case 'COMPLETE':
            console.log(action);
            return state.filter(item => item.id === action.id);
    }
    return state;   
}

export default tasks;
